";i:1599245495;}i:133;a:1:{s:7:"caption";s:1055:"Es ist ein großer, gewaltiger Gedanke, zu wissen, daß, was man auch tut, nichts vergeblich ist, daß alles seine Wirkung in die Zukunft hinein hat. So wirkt das Gesetz nicht bedrückend, sondern es erfüllt uns mit schönster Hoffnung. Es ist die schönste Gabe der Geisteswissenschaft. Wir werden froh durch das Karmagesetz, dadurch, daß wir hineinschauen in die Zukunft. Es gibt uns die Aufgabe, tätig zu sein im Sinne eines solchen Gesetzes, es hat nichts, was den Menschen traurig machen kann, nichts, was der Welt eine pessimistische Färbung geben könnte. Es beflügelt unsere Tätigkeit, mitzuwirken an dem Erden-Werdegang. In solche Gefühle muß sich das Wissen vom Karmagesetz umsetzen. 
. 
